        <div>
            <h1>Uploadphoto</h1>
            <input type="file" accept="image/*" onChange={(e) => {
                const file = e.target.files?.[0];
                if (file) {
                    const reader = new FileReader();
                    reader.onloadend = () => {
                        console.log(reader.result); // You can handle the uploaded image here
                    };
                    reader.readAsDataURL(file);
                }
            }} />
            
        </div>
    );
}

